using ll =long long;
#define format pair<ll, ll>
#define f first
#define s second
ll rec(format v[], int l, int r){//[l, r)
	if(l >= r)return LLONG_MAX; //error
	if(r - l < 3){ //brute
		ll m = LLONG_MAX;
		for(int i = l; i < r; i++){
			for(int j = 1; i + j < r; j++){
                ll cur = (v[i].f - v[i + j].f) * (v[i].f - v[i + j].f) +
					(v[i].s - v[i + j].s) * (v[i].s - v[i + j].s);
				if( cur < m)m = cur;
			}
		}
		return m;
	}
	int m = (l + r) >> 1;
	ll min_v = min(rec(v, l, m), rec(v, m, r));
    double cri;//generate border line
	if((r - l) & 1)cri = v[m].f;
	else cri = 1.0 * (v[m - 1].f + v[m].f) / 2;
	vector<format> temp; //strip zone
	for(int i = l; i < r; i++)
		if(abs(v[i].f - cri) < min_v)
			temp.push_back({v[i].s, v[i].f}); //swap to sort
	sort(temp.begin(), temp.end());
	for(int i = 0; i < temp.size(); i++){ // check 7 times
		for(int j = 1; i + j < temp.size() && j < 8; j++){
			/* 
				if using && temp[i + j].f - temp[i].f <= sqrt(min_v) instead of && j<8 
				will get tle for other but correct for 2-157; if not, only 2-157 
				will get wa.
			*/
			ll cur = (temp[i + j].f - temp[i].f) * (temp[i + j].f - temp[i].f) +
				(temp[i + j].s - temp[i].s) * (temp[i + j].s - temp[i].s);
            if( cur < min_v)min_v = cur;
		}
	}
	return min_v;
}
int main(){
	cin.tie(nullptr);
	cout.tie(nullptr);
	ios::sync_with_stdio(false);
	int n; rit(n);
	format v[n+1];
	v[0] = {0, 0};
	int input;
	ll sum = 0;
	for(int i = 1; i <= n; i++){
		rit(input);
		sum += input;
		v[i] = {sum, i};
	}
    sort(v, v + n + 1);
	ll ans = rec(v, 0, n + 1);
	wit(ans);
}

