using namespace std;

template<typename T>
struct tree{
    struct tree_node{
        T val;

        tree_node* parent;
        tree_node* left;
        tree_node* right;

        tree_node(T _val) : val(_val), parent(nullptr), left(nullptr), right(nullptr){}
    };

    tree_node* root;

    tree() : root(nullptr){}

    bool empty(){
        return root == nullptr;
    }

    void insert(T _val){
        _insert(_val,root);
    }

    void _insert(T _val, tree_node*& _root){
        if (_root == nullptr){
            _root = new tree_node(_val);
        } else if (_val < _root->val){
            _insert(_val,_root->left);
        } else if (_val > _root->val){
            _insert(_val, _root->right);
        }
    }

    void remove(T _val){
        _remove(_val,root);
    }

    tree_node* _min(tree_node* _root){
        if (_root->left == nullptr) return _root;
        _min(_root->left);
    }

    tree_node* _max(tree_node* _root){
        if (_root->right == nullptr) return _root;
        _min(_root->right);
    }

    void _remove(T _val, tree_node*& _root){
        if (_root == nullptr){
            return;
        }

        if (_val < _root->val){
            _remove(_val,_root->left);
        } else if (_val > _root->val){
            _remove(_val,_root->right);
        }

        if (_root->left != nullptr && _root->right != nullptr){
            tree_node* minimum = _min(_root->right);
            _root->val = minimum->val;
            _remove(_root->val,_root->right);
        } else if (_root->left != nullptr){
            _root = _root->left;
        } else if (_root->right != nullptr){
            _root = _root->right;
        } else {
            _root = nullptr;
        }
    }

    bool find(T _val){
        _find(_val,root);
    }

    bool _find(T _val, tree_node* _root){
        if (_root == nullptr){
            return false;
        }

        if (_root->val == _val){
            return true;
        } else if (_val < _root->val){
            return _find(_val,_root->left);
        } else {
            return _find(_val, _root->right);
        }
    }

    void print_inorder(){
        _inorder(root);
        cout << endl;
    }

    void _inorder(tree_node* _root){
        if (_root != nullptr){
            _inorder(_root->left);
            cout << _root->val << ' ';
            _inorder(_root->right);
        }
    }

    void print_postorder(){
        _postorder(root);
        cout << endl;
    }

    void _postorder(tree_node* _root){
        if (_root != nullptr){
            _postorder(_root->right);
            cout << _root->val << ' ';
            _postorder(_root->left);
        }
    }

    void clear(){
        root = nullptr;
    }
};

