            if(tmp.second == 0) {
                result[tmp.first] -= query( y1_query[tmp.first],y2_query[tmp.first]);
            }
            else {
                result[tmp.first] += query( y1_query[tmp.first], y2_query[tmp.first]);
            }
                                             
                                                    
        }
