int divide(int dividend, int divisor) {
    if(dividend == INT_MIN && divisor == -1){
        return INT_MAX;
    }
    long long dvd = labs(dividend), dvs = labs(divisor), result = 0;
    int sign = (dividend > 0) ^ (divisor > 0) == 0 ? 1 : -1;
    while(dvd >= dvs){
        long long temp = dvs, mul = 1;
        while(temp << 1 <= dvd){
            temp <<= 1;
            mul <<= 1;
        }
        dvd -= temp;
        result += mul;
    } 
    return sign*result;
}

void insert_node(tree_node* _root, tree_node* _node){
        while (_root != nullptr){
            if (_node->val > _root->val){
                if (_root->right != nullptr){
                    _root = _root->right;
                } else {
                    _node->parent = _root;
                    _root->right = _node;
                    return;
                }
            } else if (_node->val < _root->val){
                if (_root->left != nullptr){
                    _root = _root->left;
                } else {
                    _node->parent = _root;
                    _root->left = _node;
                    return;
                }
            }
        }
    }

